INSERT INTO `automatizador` VALUES (1,'Automatizar Ações de Dano Moral em Juizados Especiais','Se Soma.Pesos >= 210 faça\n  Ação.Minutar.Modelo(1:\"Sentença Danos Morais Juizado Especial\")\n  Ação.MoverLocalizacao(1:\"Revisão Sentença\")\nFim','Processo.Classe.CodigoUnificado = \"436\" (Peso: 10)  E\nProcesso.Assunto.CodigoUnificado = \"7779\" (Peso: 20) E\nProcesso.Autos.PeticaoInicial contem (\"Inexistência de Contrato\",\n\"Nunca Contratou\", \"Não assinou\")  (Peso: 100) E\nProcesso.Autos.Contestacao Não Contem (\"contrato número [número]\")   E\nProcesso.Autos.PeticaoInicial Similaridade de 97% com\nProcesso[07001549520098240008].Autos.PeticaoInicial (Peso: 200) \nProcesso.Autos.Contestacao não contem (\"existe o contrato\")  (Ação: Desconsiderar) \n');
