INSERT INTO `minuta` VALUES (1,'Sentença Danos Morais Juizado Especial','Sentença – Reparação – Abalo de Crédito – Desconstituição do Débito e Desfazimento da Negativização – Padrão\n\nRELATÓRIO\n[$NMPESSOAATIVA] propôs(useram) demanda em face de [$NMPESSOAPASSIVA], objetivando a desconstituição de débito, o cancelamento definitivo de ato(s) notarial(is) [Se ][e/OU: de negativação] e a reparação pelo abalo de crédito correlato, sob o(s) argumento(s) de que as mercadorias referentes às duplicatas questionadas.\nA(s) parte(s) acionada(s), em contestação, refutou(aram) os argumentos deduzidos na petição inicial.\nApós o regular trâmite, os autos vieram conclusos.\n[$Se Processo.Autos Contem  “julgamento antecipado”]\nJulgo o processo antecipadamente, porquanto contém substrato probatório suficiente para a formação do convencimento do juízo acerca da matéria, consoante art. 355, I, do CPC.\nNotadamente, a controvérsia pode ser equacionada lidimamente mediante a análise do substrato documental coligido aos autos, de acordo com a legislação vigente e sem olvidar do debate intelectual deduzido nas peças processuais apresentadas pelas partes. Trata-se de tema preponderantemente de direito, que dispensa a produção de prova oral em audiência ou mesmo a realização de exame pericial, de modo a justificar o imediato ingresso no mérito da causa. \nQuanto ao preceito legal invocado, Nelson Nery Junior leciona que “o dispositivo sob análise autoriza o juiz a julgar o mérito de forma antecipada, quando a matéria foi unicamente de direito, ou seja, quando não houver necessidade de fazer-se prova em audiência. Mesmo quando a matéria objeto da causa for de fato, o julgamento antecipado é permitido se o fato for daqueles que não precisam ser provados em audiência, como, por exemplo, os notórios, os incontroversos etc” (In Código de Processo Civil Comentado. 10 ed. São Paulo: RT, 2008. p. 600).\nNo atinente ao pedido de desconstituição/resolução de obrigação jurídica, este depende da demonstração da ocorrência de alguma das seguintes alternativas: a) algum de seus elementos constitutivos (agente, declaração de vontade, objeto e forma) seja inexistente, nulo ou anulável, consoante interpretação dos arts. 104 a 184 do Código Civil (CC); b) uma das partes está inadimplente e a outra não prefere exigir o cumprimento, conforme art. 475 do Estatuto Cível; c) há desequilíbrio contratual, ou seja, onerosidade excessiva, seja na data da celebração ou posteriormente por situações imprevistas (rebus sic stantibus), ressalvados os ajustes aleatórios, conforme disciplina dos arts. 478 a 480 do CC; ou, d) a dívida já se encontra quitada e, portanto, não pode ser exigida em duplicidade, nos termos dos arts. 319 e 940 do CC.\nAcrescento que a interpretação das cláusulas contratuais deve observar os usos e costumes locais e a intenção das partes (arts. 112 e 113 do CC), bem como pautar-se pelos vetores principiológicos da boa-fé objetiva e da função social dos ajustes. \nAplicando tal entendimento ao caso concreto, verifico que *\n[$ Fim Se]\n[$Se Processo.Autos Contem  “contrato sujeito ao CDC”]\nEm se tratando de negócio jurídico sujeito ao Código de Defesa do Consumidor, considerando a adesividade do ajuste (art. 54 do CDC) e a natureza consumerista da relação negocial (arts. 2º e 3º do CDC), agrego que a validade da estipulação depende também (além do exposto acima quanto aos contratos em geral) da prévia cientificação inequívoca quanto ao seu alcance (arts. 6º, VIII, 46 e 54, § 3º, do CDC), da inexistência de abusividade (art. 51 do CDC) e do equilíbrio da contraprestação, seja no dia da pactuação como posteriormente, por situações imprevisíveis, salvantes as avenças tipicamente de risco e aposta (art. 51, § 1º, III, do CDC). \n[$ Fim Se]\n\n\n[$Se Processo.Autos Contem  “desconstituição de contrato”]\nEm decorrência da resolução do negócio jurídico, as partes merecem ser restituídas ao estado anterior (status quo ante) e o prejudicado indenizado por perdas e danos, tanto diretos (imediatamente decorrentes da inadimplência) como indiretos (mediatamente oriundos do descumprimento, ou seja, lucros cessantes), conforme interpretação dos arts. 402 a 404 e 475 do CC, desde que devidamente comprovados, conforme art. 373, I, do CPC. \n[$ Fim Se]\n');
